import React, { Component } from 'react';
import axios from 'axios'
import Select from '@material-ui/core/Select';

export default class Region extends Component {
    state = {
        prop: [],
        filtro: ''
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }

    render() {
        const { prop } = this.state
        const { filtro } = this.state

        return (
            <div>
                {prop.map(item => {
                    if (item.region == 10 && item.category == filtro ) {
                        return (
                            <div key={item.id}>
                                <h3>{item.tittle}
                                    <li>{item.region}</li>
                                    <li>{item.category}</li>
                                </h3>
                            </div>
                        )}

                    }
                )}
            </div>
        )
    }
}
